import React from 'react'
import EmailIcon from '@mui/icons-material/Email';

function Contact () {
    return (
        <div id="contact">
            <h2>Contact Me</h2>
            <EmailIcon
                fontSize="large"
            />
        </div>
    );
}

export default Contact;
